import React from 'react';
import ListTD from './ListTD';
import ListArr from './ListArrTD';
import { useState } from 'react';

function ListMainTD(){
    var [text,ChangeText] = useState('');
    const inputText=(e)=>{
        ChangeText(e.target.value);
    }
    return (
        <>
        <div className="frm">
            <input 
            type="text"
            placeholder='Enter List'
            onChange={inputText}
            value={text}
            />
            <span><button>Add</button></span>
        </div>
       { ListArr.map((value,index)=>{
        return(
            <ListTD 
            Key ={value.id}
            desc={value.desc}
            />
        )
       })}
        </>
    )
}
export default ListMainTD;
